int parition(int *nums, int start, int end)
{
    int value = nums[start];
    int left = start;
    int right = end +1;
    while (1)
    {
        //找到最大的数
        while (nums[++left] < value)
        {
            if (left == end)
            {
                break;
            }
        }
        //找到最小的值
        while (nums[--right] >value)
        {
            if (right == start)
            {
                break;
            }
        }
        if (right<= left)
        {
            break;
        }
        int temp = nums[left];
        nums[left] = nums[right];
        nums[right] = temp;
    }

    int temp = nums[start];
    nums[start] = nums[right];
    nums[right] = temp;
    return right;
}

void sort(int *nums, int start, int end)
{
    if (end <= start)
    {
        return;
    }
    int p = parition(nums, start, end);
    sort(nums, start, p-1);
    sort(nums, p+1, end);
}

void quick_sort(int *nums, int size)
{
    if (nums == NULL || size <= 1)
    {
        return;
    }
    sort(nums, 0, size-1);
}

struct cListNode
{
    long long value;
    unsigned long long count;
    struct  cListNode * next;
}cListNode;

void insert(struct cListNode *list_ptr, long long value)
{
    struct cListNode * prev_list_ptr = NULL;
    struct cListNode * cur_list_ptr = list_ptr->next;
    while (cur_list_ptr)
    {
        if (cur_list_ptr->value > value)
        {
            struct cListNode * new_list_ptr = malloc(sizeof(struct cListNode));
            new_list_ptr->value = value;
            new_list_ptr->count =1;
            new_list_ptr->next = NULL;
            if (!prev_list_ptr)
            {
                list_ptr->next = new_list_ptr;
                new_list_ptr->next = cur_list_ptr;
            }
            else 
            {
                prev_list_ptr->next = new_list_ptr;
                new_list_ptr->next = cur_list_ptr;
            }
            return;
        }
        else if (cur_list_ptr->value < value)
        {
            prev_list_ptr = cur_list_ptr;
            cur_list_ptr = prev_list_ptr->next;
        }
        else
        {
            ++cur_list_ptr->count;
            return;
        }
    }
     struct cListNode * new_list_ptr = malloc(sizeof(struct cListNode));
            new_list_ptr->value = value;
            new_list_ptr->count =1;
            new_list_ptr->next = NULL;
    if (!prev_list_ptr && !cur_list_ptr)
    {
        list_ptr->next = new_list_ptr;
    }
    else if (prev_list_ptr && !cur_list_ptr)
    {
        // printf("prev value = %u, value = %u\n", prev_list_ptr->value, value);
        prev_list_ptr->next = new_list_ptr;
        new_list_ptr->next = cur_list_ptr;
    }
}


int find(struct cListNode * list_ptr, long long value)
{
    int num = 0;
    struct cListNode * prev_list_ptr = NULL;
    struct cListNode * cur_list_ptr = list_ptr->next;
    while (cur_list_ptr)
    {
        if (cur_list_ptr->value <= value)
        {
            num += cur_list_ptr->count;
            prev_list_ptr = cur_list_ptr;
            cur_list_ptr = prev_list_ptr->next;
        }
        else if (cur_list_ptr->value > value)
        {
           return num;
        }
        
    }
    return num;
     
}


void remove_node(struct cListNode* list_ptr, long long value)
{
     int num = 0;
    struct cListNode * prev_list_ptr = NULL;
    struct cListNode * cur_list_ptr = list_ptr->next;
    while (cur_list_ptr)
    {
        if (cur_list_ptr->value > value)
        {
            return;
        }
        else if (cur_list_ptr->value < value)
        {
           
            prev_list_ptr = cur_list_ptr;
            cur_list_ptr = prev_list_ptr->next;
        }
        else
        {
           if ( cur_list_ptr->count ==1)
           {
               if (!prev_list_ptr)
               {
                   list_ptr->next = cur_list_ptr->next;
                   
               }
               else 
               {
                   prev_list_ptr->next = cur_list_ptr->next;
               }
               free(cur_list_ptr);
               return;
           }
           else 
           {
               --cur_list_ptr->count;

           }
           return;
        } 
        
    }
}

